import React, { Component } from 'react'
import SocialItems from './SocialItems'

class Social
 extends Component {
  render() {
    return (
      <div>

        <SocialItems type="Facebook" id = "facebook" />
        <SocialItems type="Youtube" id = "youtube" />
        <SocialItems type="Instagram" id = "instagram" />

      </div>
    )
  }
}

export default Social;
